    return (
        <div key={item.id}>
           <span>{item.name}</span>
           <span>{item.age}</span>
           <span onClick={() => toodelet(item.id)}>&times;</span>         
       </div>
    );
 })

    return(
       
        <div className="Listitems">
             <div>
            <span>name</span>
            <span>age</span>
            <span>action</span>
        </div>
            {ListItems}
        </div>
    );

}

export default Too
